import React from "react";
import { Header } from "./../components/Header";
import { Results } from "./../components/Results";

import {Container} from 'react-bootstrap';

const container = {
  backgroundColor: '#EEEEEE'
};
const Home = () => {
  return (
    <Container style={container}>

      <Header />
      <Results />

    </Container>
  );
};

export default Home;
